Organise tes matchs en 2 clics et rejoins une communauté de joueurs de foot, badminton, padel,.. autour de toi !

Tu veux jouer au foot ou au badminton et tu cherches un joueur pour ton match ?

1- Installe l'application Padel Magic;
2- Réserve un créneau;
3- Crée ton match et invite un ami à le rejoindre en lui partageant le lien ;
4- Trouve un joueur de ton niveau pour compléter ton match ;

C'est tout ! 

POURQUOI UTILISER L'APPLICATION L'AUTRE USINE?

RÉSERVER TON CRENEAU EN 30 SECONDES
Fini la corvée de téléphone ! Avec l'application tu n'as plus qu'à accéder aux créneaux disponibles et à en choisir un. Le centre recevra alors automatiquement ta réservation.
Une évolution ? Non, plutôt une révolution !

REJOINDRE UN MATCH AUTOUR DE TOI
T’es chaud pour jouer au squash, Foot, Padel ? Aucun problème !
Consulte les matchs proposés par les autres joueurs. Dès que tu as trouvé le match qu'il te faut, inscris-toi  !

TROUVER LE JOUEUR MANQUANT
Tu as envie de jouer mais tu es seul ? Pas de panique, on a pensé à tout !

1. Publie ta recherche de joueur et propose ton match à la communauté ;
2. On te prévient dès qu’un joueur rejoint ton match ;
3. Tu peux discuter avec le joueur inscrit (pour te renseigner sur le niveau, demander un covoiturage...) ;
4. Complète ton match et fais-toi de nouveaux partenaires !

CRÉER TA PROPRE COMMUNAUTÉ DE SPORTIFS
Tu peux désormais ajouter en ami les joueurs de ton choix :
- Rends-toi sur le profil du joueur ;
- Envoie lui une demande d'ami ;
- Invite le lors de ton prochain match ;
